import React, {t } from "react";

interface Session {
  user?: {
    name: string;
    email: string;
    // ... other properties
  };
  accessToken?: string;
  // ... other session properties
}

export default async function PublicWrapper({
  children,
  session,
}: Readonly<{
  children: React.ReactNode;
  session: Session;
}>) {
  return React.cloneElement(children, { session: session });
}
